オートグリムは英国生まれのカーケア・ケミカル・ブランド。プロフェッショナル用として生まれ、自動車メーカーや磨き業者などの多くのプロから支持され続けてます。そのテクノロジーを惜しみなく投入したカーオーナー向け商品をご紹介します。 <br>耐久性のある特殊配合のポリマーと保護成分が、ツヤと輝きをタイヤに与えます。自然なツヤをご希望の場合は塗布後、そのまま放置してください。ツヤ消し仕上げが希望なら乾燥する前に乾拭きで仕上げてください。<br>■タイヤ用保護ツヤ出し剤　　　■容量：500ml　　　■カープレミアムカーケアジャパン正規品 <br>ユニバーサル <br>　車検対応品<br>カーケア/ワックス<tr><td colspan="2">
